import React from "react";
import { Container, Nav } from "react-bootstrap";

const MainNavbar = () => {
  return (
    <Container fluid>
      <Nav className="navbar navbar-dark bg-dark text-white">
        <h1>Expense Mangement System</h1>
      </Nav>
    </Container>
  );
};

export default MainNavbar;
